function load_effect_rproducts() {
    $matherfuck_ie = false;
    $('.rproductsLink').hover(function() {
        if ($('#rproductsContentInfo_' + $(this).attr('rel')).css('display') != 'none') {
            $('#rproductsContentInfo_' + $(this).attr('rel')).animate({
                top: '-' + $(this).height() + 'px'
            }, {
                queue: false,
                duration: 300
            });
        } else {
            $('#rproductsContentInfo_' + $(this).attr('rel')).css('top', '-' + $(this).height() + 'px');
            $('#rproductsContentInfo_' + $(this).attr('rel')).css('display', 'block');
            $matherfuck_ie = true;
        }
    }).mouseout(function() {
        if (!$matherfuck_ie) {
            $('#rproductsContentInfo_' + $(this).attr('rel')).stop().animate({
                top: '1'
            }, {
                queue: false,
                duration: 300
            });
        } else {
            $('#rproductsContentInfo_' + $(this).attr('rel')).css('top', '1px');
            $('#rproductsContentInfo_' + $(this).attr('rel')).css('display', 'none');
        }
    });
};;
